import mem1 from "../images/mem1.jpeg"


const MEMES = [
    {
        title: "Mem1",
        upvotes: 6,
        downvotes: 0,
        img: "mem1.jpeg",
    },
    {
        title: "Mem2",
        upvotes: 6,
        downvotes: 0,
        img: "../images/mem1.jpeg",
    },
];

export const Memlist = () => {
    return (
        <div>


            {MEMES.map((mem) => {
                return (
                    <img src={process.env.PUBLIC_URL + '/mem1.jpeg'} alt="logo" />
                    // <img src="images/mem1.jpeg" alt="mem1" />
                    // <li key={mem.title}>

                    // </li>
                );
            })}

        </div>
    );
}
